import React, { useState } from "react";
import Navbar from "../navbar/Navbar";
import Login from "../login/Login";
import Signup from "../signup/Signup";
import "./home.css";

const Home = () => {
  const [showLogin, setShowLogin] = useState(false);
  const [showSignup, setShowSignup] = useState(false);

  return (
    <div className="home-container">
      {/* Navbar with Login & Signup Buttons */}
      <Navbar
        onLoginClick={() => setShowLogin(true)}
        onSignupClick={() => setShowSignup(true)}
      />
      
      {/* Home Content */}
      <div className="home-content">
        <div className="text-container">
          <h1></h1>
          <p>
            Experience a cutting-edge platform that streamlines task organization
            and enhances collaboration. Our intuitive platform allows for seamless
            teamwork, real-time tracking, and efficient task management.
          </p>
          <button className="btn-secondary">Get Started</button>
        </div>
        <div className="image-container">
          <img src="/images/image.png" alt="Home" className="home-image" />
        </div>
      </div>

      {/* Feature Section */}
      <div className="features-section">
        <div className="features-text">
          <h1>Empower Your Team with Zidio Task Management</h1>
          <p>
            Our platform enhances efficiency and collaboration, allowing you to
            take control of your projects effortlessly.
          </p>
          <div className="features-list">
            {[
              {
                title: "1. Dynamic Kanban Boards",
                text: "Visualize your workflow and prioritize tasks with clarity, enhancing accountability among team members."
              },
              {
                title: "2. Real-Time Updates",
                text: "Stay informed as projects evolve, ensuring your team remains synchronized and adaptable."
              },
              {
                title: "3. Seamless Integrations",
                text: "Integrate with existing tools to streamline processes and maintain productivity without interruption."
              }
            ].map((feature, index) => (
              <div key={index} className="feature">
                <h2>{feature.title}</h2>
                <p>{feature.text}</p>
              </div>
            ))}
          </div>
        </div>
        <div className="features-image">
          <img src="/images/page3.png" alt="Features" className="feature-image" />
        </div>
      </div>

      {/* Cards Section Heading */}
      <h1 className="cards-heading">
        Experience the transformative capabilities of Zidio Task Management
      </h1>
      
      {/* Cards Section */}
      <div className="cards-container">
        {[
          {
            src: "/images/card1.png",
            alt: "Kanban Boards",
            title: "Robust Task Organization with Kanban Boards",
            text: "Visualize your workflows and prioritize tasks effectively, ensuring your team is always aligned."
          },
          {
            src: "/images/card2.png",
            alt: "Progress Tracking",
            title: "Real-Time Progress Tracking",
            text: "Stay up-to-date with your projects and make swift adjustments to keep everything on course."
          },
          {
            src: "/images/card3.png",
            alt: "Seamless Integrations",
            title: "Seamless Integrations",
            text: "Integrate with the tools you already use, simplifying your workflow and reducing app-switching."
          }
        ].map((card, index) => (
          <div key={index} className="card">
            <img src={card.src} alt={card.alt} className="card-image" />
            <h3>{card.title}</h3>
            <p>{card.text}</p>
          </div>
        ))}
      </div>

      {/* FAQ Section */}
      <div className="faq-section">
        <h1>Frequently Asked Questions</h1>
        <div className="faq-list">
          {[
            { question: "How can Zidio support my team's productivity?", answer: "Zidio helps streamline task organization, track progress, and enhance collaboration among teams." },
            { question: "What features make Zidio unique?", answer: "Zidio offers dynamic Kanban boards, real-time updates, and seamless integrations with popular tools." },
            { question: "How does Zidio drive teamwork?", answer: "By centralizing task management, providing transparency, and fostering collaboration among team members." },
            { question: "What support options do you offer?", answer: "We offer comprehensive online support and training materials for all users." },
            { question: "How can I get started with Zidio?", answer: "Simply sign up, choose your plan, and start using Zidio for effortless task management." }
          ].map((faq, index) => (
            <div key={index} className="faq-item">
              <h3>{faq.question}</h3>
              <p>{faq.answer}</p>
            </div>
          ))}
        </div>
      </div>

      <footer className="footer">
  <div className="footer-content">
    {/* Footer Text */}
    <div className="footer-text">
      <h1>Zidio Tool Management</h1>
      <p>
        Zidio Task Management showcases our commitment to innovation and
        efficiency, offering a user-friendly platform for task organization,
        progress tracking, and team collaboration. With features like Kanban
        boards, real-time updates, and seamless integrations, it streamlines
        workflows and enhances productivity.
      </p>
    </div>

    {/* Contact Information */}
    <div className="footer-contact">
      <h2>Contact Information</h2>
      <p>123 Zidio Ave, Suite 456, Management City, NC 28201</p>
      <p>+1 (888) 123-4567</p>
      <p>info@zidiotoolmanagement.com</p>
    </div>

    {/* Quick Links */}
    <div className="footer-links">
      <h2>Quick Links</h2>
      <ul>
        <li>Our Services</li>
        <li>Features</li>
        <li>Pricing</li>
        <li>Help Center</li>
        <li>About Us</li>
        <li>What We Stand For</li>
        <li>Blog</li>
      </ul>
    </div>
  </div>

  {/* Copyright Section */}
  <div className="footer-rights">
    <p>Â© 2025 Zidio Tool Management. All Rights Reserved</p>
  </div>
</footer>


      {/* Login Popup */}
      {showLogin && <Login onClose={() => setShowLogin(false)} />}

      {/* Signup Popup */}
      {showSignup && <Signup onClose={() => setShowSignup(false)} />}
    </div>
  );
};

export default Home;
